Information
------------------------------

Rise of the Super Rats
New evidence uncovered by the University of Huddersfield shows that rats across large swathes of Britain have now genetically evolved to withstand commonly available poisons. The research found that some towns had rats that were 100% resistant to over-the-counter poisons. Rats have long been considered deadly pests - spreading disease, damaging food stocks and damaging homes. They are carriers of potentially fatal illnesses like Weil's disease, Lassa fever and bubonic plague to name but a few. Genetic tests show that rodents across the nation have developed a mutation that allows them to survive conventional poisons, and these `super rats' are spreading to new areas of the country. Now communities are running out of defences as the Government contemplates the future of rodenticide use. Chris Choi reports

